import React from "react";
import './style.css'

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        Searches
      </a>
      <a className="navbar-brand" href="/work">
        Work
      </a>
      <a className="navbar-brand" href="/contact">
        Contact
      </a>
    </nav>
  );
}

export default Nav;
